import React, { Component } from 'react';
import './Todo.css';

class Todo extends Component {
  render() {
    return (

<div id="{this.props.id}" className="todo">
        <button id= "check" className="check">Check</button>
        <p> {this.props.text}
        <input type="checkbox" id="checked"></input>
        <button id= "delete" className="delete">Delete</button>

        </p>
      </div>
    );
  }
}

export default Todo;
